class World:
    def __init__(self):
        self.world = ""
        self.position = 0
        self.lastIndex = len(self.world)-1
    def add(self):
        if self.position==self.lastIndex: self.position = 0
        self.position += 1
    def get(self):
        now = int(self.world[self.position])
        self.add()
        return now

if __name__=="__main__":
    world = World()
    for i in range(100):
        print(world.get())